import React from "react";

function SongPage({ song }) {
    return (
      <div className="card">
        <img
          className="card-img-top"
          src={song.image}
          alt={song.name}
        />
        <div className="card-body">
          <h4 className="card-title">{song.name}</h4>
          <p className="card-text">
            {song.artist.name}
          </p>
        </div>
      </div>
    );
  }

  export default SongPage;
